import React from 'react';
import './index.css';
import * as ReactDOM from 'react-dom/client';
import { ApolloClient, InMemoryCache, ApolloProvider, gql } from '@apollo/client';
import App from './App';


const client = new ApolloClient({
    uri: 'http://localhost:4000',
    cache: new InMemoryCache(),
});

// client
// .query({
//     query: gql`
//         query Categories {
//             categories {
//                 name
//                 products {
//                     name
//                     inStock
//                     gallery
//                     description
//                     category
//                     brand
//                 }
//             }
//         }
//     `
// })
// .then((result) => console.log(result))

client
.query({
    query: gql`
        query Categories {
            categories {
                name
                products {
                    name
                    inStock
                    gallery
                    description
                    category
                    brand
                    id
                    attributes {
                        id
                        name
                        type
                        items {
                            displayValue
                            value
                            id
                        }
                    }
                    prices {
                        currency {
                            label
                            symbol
                        }
                        amount
                    }
                }
            }
        }
    `})
.then((result) => console.log(result))

const root = ReactDOM.createRoot(document.getElementById('root'));

root.render(
    <ApolloProvider client={client}>
        <App />
    </ApolloProvider>,
);
